import { BrowserRouter as Router, Switch, Route, Link } from "react-router-dom";
import { Footer, getNavItems, Header, Main, Navbar } from "../components";
import "./App.scss";

function Home() {
  return (
    <main className="Home">
      <section className="bio">
        <div>
          <img alt="A photo of Aaron Rine" />
          <p>short quote</p>
        </div>
        <p></p>
        <p></p>
        <p></p>
      </section>
      <section className="carousel">carousel</section>
      <section className="contact">contact</section>
    </main>
  );
}
function ProjectDetails() {
  return <div>about</div>;
}
const routes = [
  { path: "/", component: Home },
  { path: "/home", component: Home },
  { path: "/projectdetails", component: ProjectDetails },
  { path: "*", component: Main },
];
function App() {
  return (
    <Router>
      <div className="App">
        <Header />
        <Navbar navItems={getNavItems()} />
        <Switch>
          {routes.map((route) => (
            <Route exact {...{ ...route }} />
          ))}
        </Switch>
        <Footer />
      </div>
    </Router>
  );
}

export default App;
